import React from 'react'

export const Header = () => {
  return (
    <div class="breadcrumb-wrapper h-[50vh] flex justify-center items-center flex-col ">
 <h1 className='text-orange-950 font-bold'>Course Enrollment</h1>
 <p className='w-[70vw]'>At <span className='bg-orange-950 text-orange-500 p-1'>SkillsEducation</span>, enrolling in a course is your first step toward building a brighter future. Our streamlined enrollment process ensures you can quickly join the course of your choice and begin your learning journey. Explore our offerings and find the perfect course to match your ambitions and goals.</p>
  </div>
  )
}
